import React, {Dispatch, useEffect, useState} from "react";
import Logo from '../assets/images/top_logo.png';
import BaseButtons from "./commons/baseButtos";

interface Props {
    type?: string;
    setType : React.SetStateAction<Dispatch<string>>
}
export default function Header({type, setType} : Props) {
    const [text, setText] = useState('');

    useEffect(() => {
        if(type === '01') setText('마이체크업');
        if(type === '02') setText('벨류맵');
    }, [type]);
    return (
        <div>
            <img src={Logo} alt={'Logo'} />
            <div>
                <BaseButtons  text={text} className={''}/>
                <BaseButtons  text={text} className={''}/>
            </div>
        </div>
    )
}
